import React, { useContext, useRef, useState } from 'react';
import './Navbar.css';
import logo from '../Assets/logo.jpg';
import cart_icon from '../Assets/cart_icon.png';
import nav_dropdown from '../Assets/nav_dropdown.png';
import { Link } from 'react-router-dom';
import { ShopContext } from '../../Context/ShopContext';

const Navbar = () => {
    const [menu, setMenu] = useState("shop");
    const { getTotalCartItems } = useContext(ShopContext);
    const menuRef = useRef();

    const dropdown_toggle = (e) => {
        menuRef.current.classList.toggle('nav-menu-visible');
        e.target.classList.toggle('open');
    };

    const handleSubMenuToggle = (e) => {
        e.currentTarget.querySelector('.nav-submenu').classList.toggle('show-submenu');
    };

    return (
        <div className='navbar'>
            <Link to='/' onClick={() => { setMenu("home") }} className="nav-logo">
                <img src={logo} alt="Logo" />
                <p>EverGreen Nursery</p>
            </Link>
            <img onClick={dropdown_toggle} className='nav-dropdown' src={nav_dropdown} alt="Dropdown" />
            <ul ref={menuRef} className="nav-menu">
                <li onMouseEnter={handleSubMenuToggle} onMouseLeave={handleSubMenuToggle} onClick={() => { setMenu("home") }}>
                    <Link to='/'>Home</Link>
                    {menu === "home" && <hr />}
                </li>
                <li onMouseEnter={handleSubMenuToggle} onMouseLeave={handleSubMenuToggle} onClick={() => { setMenu("plants") }}>
                    <Link to='/plants'>Plants</Link>
                    {menu === "plants" && <hr />}
                    <ul className="nav-submenu">
                        <li><Link to='/plants/flowering'>Flowering Plants</Link></li>
                        <li><Link to='/plants/hanging'>Hanging Plants</Link></li>
                    </ul>
                </li>
                <li onMouseEnter={handleSubMenuToggle} onMouseLeave={handleSubMenuToggle} onClick={() => { setMenu("pots") }}>
                    <Link to='/pots'>Pots and Planters</Link>
                    {menu === "pots" && <hr />}
                    <ul className="nav-submenu">
                        <li><Link to='/pots/normal'>Pots</Link></li>
                        <li><Link to='/pots/hanging'>Hanging Planters</Link></li>
                    </ul>
                </li>
                <li onMouseEnter={handleSubMenuToggle} onMouseLeave={handleSubMenuToggle} onClick={() => { setMenu("tools") }}>
                    <Link to='/tools'>Tools</Link>
                    {menu === "tools" && <hr />}
                    <ul className="nav-submenu">
                        <li><Link to='/tools/garden'>Garden Tools</Link></li>
                        <li><Link to='/tools/watering'>Watering Tools</Link></li>
                    </ul>
                </li>
                <li onMouseEnter={handleSubMenuToggle} onMouseLeave={handleSubMenuToggle} onClick={() => { setMenu("gifting") }}>
                    <Link to='/gifting'>Gifting</Link>
                    {menu === "gifting" && <hr />}
                    <ul className="nav-submenu">
                        <li><Link to='/gifting/birthday'>Birthday Gifts</Link></li>
                        <li><Link to='/gifting/housewarming'>Housewarming Plant Gifts</Link></li>
                    </ul>
                </li>
            </ul>
            <div className="nav-login-cart">
                <Link to='/login'><button>Login</button></Link>
                <Link to='/cart'><img src={cart_icon} alt="" /></Link>
                <div className="nav-cart-count">{getTotalCartItems()}</div>
            </div>
        </div>
    );
};

export default Navbar;
